// src/pages/Home.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center text-center p-6 bg-gradient-to-br from-blue-200 to-blue-500">
      <h1 className="text-4xl font-bold mb-8 text-white">Welcome to the Ghana Online Voting System</h1>
      <div className="space-y-4">
        <Link
          to="/voter/login"
          className="block w-60 bg-white hover:bg-gray-100 text-blue-700 font-semibold py-3 rounded shadow mx-auto"
        >
          Login as Voter
        </Link>
        <Link
          to="/admin/login"
          className="block w-60 bg-white hover:bg-gray-100 text-green-700 font-semibold py-3 rounded shadow mx-auto"
        >
          Login as Admin
        </Link>
        <Link
          to="/voter/register"
          className="block w-60 bg-white hover:bg-gray-100 text-purple-700 font-semibold py-3 rounded shadow mx-auto"
        >
          Register as Voter
        </Link>
      </div>
    </div>
  );
};

export default Home;
